export default function Todos() {
    // const todos = localStorage.getItem(localStorage.key(0))
    const todos = []
    for(let i=0; i<localStorage.length; i++){
        let key = localStorage.key(i)
        let content = localStorage.getItem(key).split(key)
        todos.push({key: key, name: content[0], task: content[1]})
    }
    console.log(todos)
    if(todos){
        console.log()
        todos.map(todo=>{
            if(todo.name === null || todo.task === null) return false
            return(
            <>
                <li className="todos">
                    <div className="listElement">
                        <div className="listElement__elements">
                            <h1 className="listElement__elements__name">{todo.name}</h1>
                            <p className="listElement__elements__task">{todo.task}</p>
                        </div>
                    </div>
                </li>
            </>)
        })
    }
    else return false
}
